import "../../styles/components/roundchart.css"
import { RadialBarChart , RadialBar , ResponsiveContainer } from "recharts"

function RoundChart ({input}) {
    console.log(input)
    return (
        <ResponsiveContainer width="30%" height={300}>
            <RadialBarChart innerRadius="10%" outerRadius="80%" barSize={10} data={input} startAngle={360} endAngle={0}>
                <RadialBar minAngle={15} clockWise={true} data={input} dataKey="score" label={{position: "insideStart" , fill:"red"}}/>
            </RadialBarChart>
        </ResponsiveContainer>
    )
}

export default RoundChart
